 (173,'古代的你','本软件是一个娱乐休闲功能型软件，能根据你的姓名（输入姓名的拼音开头第一个字母的组合），按照一定的占卜规则，测算出你在古代身份和地位。想知道你在古代是干什么的吗？赶快来测试下你和你的朋友们吧，十分有趣的呢。','2010-12-30 16:45:04',1,'material/images/89465e3ab66b99628fdef53c0bf214c1.png','material/images/5f7d88e5c84b48c3badd18e23ae7f03f.jpg','material/images/2abc98a58a54670fc75b46bfd60f7e1b.jpg','material/images/7b5f6f349d998eca4f2a40382d234645.jpg','material/images/94be751755fed1a194f54e19a99b1a93.jpg','material/images/eec23e7913dc1e4d666bdeac5ca9e203.jpg',173,'gdrn','65428'),
 (174,'推箱子','推箱子(Sokoban)是起源于日本的一个益智游戏。Sokoban是日本语中仓库管理员的意思。本游戏的目的就是用最少的步数把一个拥挤的仓库中的所有箱子都推到目标位置上。箱子只能推动而不能拉动。一次只能推动一个箱子。注意不要把箱子推到死角上，不然就无法再推动它了。推箱子游戏规则简单，但是对于不同难度的关卡，所需要的脑力是不同的，有些关卡可能会花费您几个小时、甚至几天的时间。用四个方向按钮来进行移动。在选项中可以选择不同的关卡包。','2010-12-30 16:51:15',1,'material/images/689723f507b6afdf628c5be8ea057f5d.png','material/images/2a40bd81318801233cd6bba2e4a54819.jpg','material/images/831543ae4ebf6dfa6a3e8457614efe5b.jpg','material/images/1a4cbcb6de1863bf4f06553267d3f012.jpg','material/images/5a45261e6ea4a121f13d1bdba01a7bd7.jpg','material/images/7cb0e396a1ff1498a707b64018f32aea.jpg',174,'txz','65429'),
 (175,'数独','数独顾名思义——每个数字只能出现一次。数独是一种源自18世纪末的瑞士，后在美国发展、并在日本得以发扬光大的数字谜题。数独盘面是个九宫，每一宫又分为九个小格。在这八十一格中给出一定的已知数字和解题条件，利用逻辑和推理，在其他的空格上填入1-9的数字。使1-9每个数字在每一行、每一列和每一宫中都只出现一次。 这种游戏全面考验做题者观察能力和推理能力，虽然玩法简单，但数字排列方式却千变万化，是训练头脑的绝佳方式。这个数独软件包含50关难度各异的数独难题，此外，还支持随机生成数独难题，从而增加趣味','2010-12-30 16:58:56',1,'material/images/cd59a453b3bf77674c581c5ac20076e1.png','material/images/24749f4de1f1b5127d5fdf7f47508bfe.jpg','material/images/012bb41908f19a62559c88126dd3008d.jpg','material/images/70feb6c8b4d696abea3399291200ea4c.jpg','material/images/c45d576d35fc3e17dd1373a91b2cf566.jpg','material/images/4a485d6c20d1540d72c614731591ef3a.jpg',175,'ds','65431'),
