 (238,'GBA模拟器','GameBoid是著名的Game Boy Advance模拟器的机器人。特性：全速运行大多数游戏；定制屏幕上的键盘；保存状态；秘籍；快进（涡轮增压）；多键概况；屏幕倒置。','2011-01-07 18:10:22',1,'material/images/5e34a735c64feb8b6616cfbaa5a60fd9.png','material/images/9cb9faaedf26b382add020cef0d77d58.jpg','material/images/216454643ce4e19cd22d062212768d04.jpg','material/images/5d4e71eb60302712e6fe6dc5ed4bf491.jpg','material/images/357521a6ab9e01c8bd99e53bcf85d0b7.jpg','material/images/8204f902f32ecac40b62cd0b0138f98a.jpg',238,'GBAmnq',NULL),
 (239,'割绳子','Feelingtouch团队再度重拳出击，为国内机友带来新年大礼！Rope Cut割绳子 是feelingtouch团队最新推出的一款精品休闲益智类游戏。游戏风格轻松明快，画面可爱；游戏音乐音效均由专业团队打造。游戏通过简单的手指划屏动作实现切割绳子，通过不同位置不同时间的切割动作，配合使用气泡以及吹气工具，来收集星星已经使糖果掉落到小蛇的嘴中。','2011-01-07 18:16:02',1,'material/images/554785272f29018983310511aaf95cac.png','material/images/79aa80517dc00eb35f097236cfa33a86.jpg','material/images/4bac4e388df50aa0e4b51239d3b5cfc1.jpg','material/images/9f33bd537699fde5874b63a4dd932c7f.jpg','material/images/210f54587d26678c30a959ccc3b01843.jpg','material/images/bc544c7f47b1fcbb5cdc9141a97d1580.jpg',239,'gsz',NULL),
 (240,'疯狂躲避球','让我们一起加入到快节奏的疯狂躲避球中来吧，去打败游戏中5个角色所控制的世界，通过联赛模式和小游戏模式的完成将有机会让我们成为躲避球历史中的一部分。游戏操作其实很简单：扔球，躲避，胜利','2011-01-07 18:21:11',1,'material/images/92c5c6bebd1c7bde114ae9306c22437b.png','material/images/46e1542790e8d83a5268a131995eef68.jpg','material/images/b723eef6555434a3dd0e46e62f8b6dad.jpg','material/images/7f6aa9e3349d2f183408f03144160af2.jpg','material/images/142e7bc5981e7ccad4239229c836c376.jpg','material/images/7e94ce9ec6eb79b106725ffed495150f.jpg',240,'fkdbq',NULL),
 (241,'嘻哈三国塔防','这是一款可以让你杀的天昏地暗的游戏！合理布置五种防御塔，并让武将协助你防御敌人疯狂的进攻，保卫城池不被击破！浓郁的中国风游戏背景，搭配可爱逗趣的嘻哈画风，给你全新的视觉体验！','2011-01-07 18:23:38',1,'material/images/f4f62f378c62c5e9e90e9f2181e4190f.png','material/images/9d68a5dfcb8160d19768be4ddc29b827.jpg','material/images/d6b5fbbf0a33887c35207372964a2f26.jpg','material/images/479c3a25bc9a5194674b8d3c8a58c6cb.jpg','material/images/67dea775de6a214b23d26d48422eee18.jpg','material/images/4deefcbbd0c5da3f76edf04de301af9b.jpg',241,'xhsgtf',NULL),
 (242,'春秋online','掌上春秋是一款多人在线的策略类游戏。游戏中玩家将扮演一位氏族首领从氏族村落发展成为称霸一放的诸侯国的历程。','2011-01-07 18:25:36',1,'material/images/26471112f207b87215101865c43d20f2.png','material/images/d1e5a8d5e9cc3df46f88e443375b986b.jpg','material/images/d8fd155e97fa95565a04cc2bc9f5244b.jpg','material/images/637dcdef605690aba613942a09ff634e.jpg','material/images/59bc23bfac8dd90e5aff934ad8302a59.jpg','material/images/12ceb2759c32077d68a2ddbbfc117b40.jpg',242,'cqwy',NULL),
 (243,'植物大战僵尸','一个看似简单实则极富策略性的小游戏。可怕的僵尸即将入侵你的家庭，你唯一的防御方式就是您栽种的植物。此版本非官方版，但是品质已经很不错了，喜欢的朋友不要错过。','2011-01-07 18:29:13',1,'material/images/0e9b30a62a8cb66d8647d163b9173eec.png','material/images/accbd95c2e8b206b59cb5f4919c75773.jpg','material/images/769c0a7468cac713b9338103450b096a.jpg','material/images/b1585a85109970dd45637be56d41277c.jpg','material/images/27746af7548366b31be05e29d612e1d1.jpg','material/images/f36d3ded07b90bec04bfc60fd665e377.jpg',243,'zwdzjs',NULL),
 (244,'愤怒的小鸟','这款游戏的故事相当有趣，为了报复偷走鸟蛋的肥猪们，鸟儿以自己的身体为武器，仿佛炮弹一样去攻击肥猪们的堡垒。游戏是十分卡通的2D画面，看着愤怒的红色小鸟，奋不顾身的往绿色的肥猪的堡垒砸去，那种奇妙的感觉还真是令人感到很欢乐。而游戏的配乐同样充满了欢乐的感觉，轻松的节奏，欢快的风格。不过在进行游戏的时候却没有这样的音乐，有点可惜。但是将鸟儿们弹射出去时，鸟儿的叫声倒是给人很好笑的感觉。','2011-01-07 18:32:07',1,'material/images/d9dff49b5cd4e36c942d2f0ed153442d.png','material/images/0b092e8d1b716fb97c151870a42ed030.jpg','material/images/7607067905cb9943e02067e598f4b2c6.jpg','material/images/5bbce465f407736a845732ef362b2c07.jpg','material/images/bff1dcb302bcbb08b4856088fd7d221b.jpg','material/images/94dec6819268e3836bf80e384c8c978a.jpg',244,'fnrxn',NULL),
 (245,'追讯','追讯将互联网热点内容进行聚合，即时将更新内容发送给您。您只需订制您所感兴趣的内容，包括新闻、网页、博客、小说，微薄，财经，找工作，团购等资讯。让您节省上网时间，轻松获取互联网上您感兴趣的最新内容。','2011-01-11 10:06:37',1,'material/images/419d43f0dcd197d1df912f7bfde2ca41.png','material/images/a61238c9cfd2f47b3989f846bb2a1aea.jpg','material/images/39db141980e355e0ea8f8710d0d2787d.jpg','material/images/875f064d10380f9a94fd309edd273cd9.jpg','material/images/1e0e8e184f0c2ea3128a6cbe2ba6bc61.jpg','material/images/90c89bf2139b45c6b4efe7422af97289.jpg',245,'zuixun','65443'),
 (246,'书签管理器','可以手动或自动（按首字母或创建时间）排序书签可以方便地在手机或其他Android版本之间转移数据','2011-01-11 10:32:06',1,'material/images/72f058fe9518c0ab2a9ef3c7734f54d3.png','material/images/819ad2b5591c69862ed6828c38dd77e3.jpg','material/images/ca532300e90638a33ba98c01c99dc951.jpg','material/images/d56f31a436aeb8c510edb51979b67cac.jpg','material/images/53ddfab7e544432674b29a1266eeb9ac.jpg','material/images/cad07fdc29dd3a6495676bd96b645cf8.jpg',246,'sqglq','65603');
